import React, { Component } from "react";
import Navigation from "../components/Navigation";
import { porfolioData } from "../data/porfolioData";

class Portfolio extends Component {
  state = {
    myPorftolio: porfolioData
  };
  render() {
    return (
      <>
        <Navigation />
        <div className="col-xl">
          <h1 className="profile display-4 fw-bolder">Portfolio</h1>

          {myPorftolio.map(portfolio => (
            <div className="card" style={{ width: "23rem", height: "330px" }}>
              <img src={portfolio.myImg} className="card-img-top" alt="..." />
              <div className="card-body ">
                <h3 className="card-title">{portfolio.mytitle}</h3>
                <p className="card-text">{portfolio.myContent}</p>
              </div>
            </div>
          ))}
        </div>
      </>
    );
  }
}

export default Portfolio;
